import React from 'react';
import './AlgorithmSelector.css';

const algorithms = [
  { name: '선택 정렬', image: 'selection-sort.gif' },
  { name: '삽입 정렬', image: 'insertion-sort.gif' },
  { name: '버블 정렬', image: 'bubble-sort.gif' },
  { name: '병합 정렬', image: 'merge-sort.gif' },
  { name: '힙 정렬', image: 'heap-sort.gif' },
  { name: '퀵 정렬', image: 'quick-sort.gif' },
  { name: '트리 정렬', image: 'tree-sort.gif' },
  { name: '팀 정렬', image: 'tim-sort.gif' }
];

const AlgorithmSelector = ({ onSelect }) => {
  return (
    <div className="algorithm-selector-popup">
      <div className="popup-content">
        <h2>정렬 알고리즘 선택</h2>
        <div className="algorithm-list">
          {algorithms.map((algo) => (
            <div key={algo.name} className="algorithm-item" onClick={() => onSelect(algo.name)}>
              <img src={algo.image} alt={algo.name} />
              <span>{algo.name}</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AlgorithmSelector;
